INSERT INTO `discharge_summaries` VALUES (1,'Review on 15.02.13 at 10 am for next cycle of Chemotherapy.','USG Study of Abdomen and Pelvis (01.02.13):-\r\nIn a known case of Ca-ovary.\r\nBilateral ovarian solid cystic lesion.\r\nGross ascitis.','2013-02-14 09:37:00',2,37,'2013-02-05 13:10:24',1,'2013-02-05 13:46:01',1,'A case of Ca - Ovary with malignant ascitis.','This 42 yrs female patient admitted with Diagnosed case of Ca-ovary with malignant ascitis.\r\nHistory of Abdominal pain with gradually increased distension of abdomen since 6 - 8 month.\r\nNo history of DM, HTN, BA, IHD.\r\nPatient admitted here for further management and treatment.','98.4','78','20','98.4','General examination :- General condition - Not Satisfactory / Afrebrile\r\n                    Pulse - Regular, Pallor - Mild, Icterus - Absent, Cyanosis - Absent\r\nRS                  :- Bilateral occ. crepts (+) \r\nC V S               :- S1 S2 (N)\r\nAbdomen             :- Distended, Ascitis(+) Tenderness (+).\r\n                       Liver - Not Palpable / Spleen - Not Palpable\r\nCNS                 :- Conscious, Oriented, Moving all four limb.','1st cycle of Chemotherapy done on date 02.02.13.','satisfactory'),(2,'Urgent Care / Emergency care is available 24 X 7 Please  Contact :- 0712-6627900\r\nReport back to the hospital immediately in case of Severe headache, Convulsions, fever, Giddiness / Vertigo, Unconsciousness.\r\n\r\nSuture removal after 10 days.\r\nReview after 10 days. ','','2013-02-17 21:23:00',14,87,'2013-02-09 06:26:26',1,'2013-02-09 07:06:08',1,'A case of  Frontal EDH with mass effect.','This 16 yrs male patient admitted with history of accidental trauma by a Bat while playing cricket on Sunday (03.01.013)with his colleagues, since then complaining of unable to speech properly, vomiting.\r\nInitially treated at Bhandara then shifted here for further management and treatment.','98.4','78','24','98.4','General examination :- General condition - Not Satisfactory / Afrebrile\r\n                       Pulse - Regular, Pallor - (+), Icterus - Absent, Cyanosis - Absent RS                  :- Bilateral occ. crepts (+)\r\nC V S               :- S1 S2 (N)\r\nAbdomen             :- Soft, Non - Tenderness.\r\n                       Liver - Not Palpable / Spleen - Not Palpable \r\nCNS                 :- Conscious, Oriented, Pupils unequal RTL, Moving all four limb.','','satisfactory'),(3,'','','2013-02-12 05:02:00',16,139,'2013-02-10 05:05:42',1,'0000-00-00 00:00:00',0,'','','','','','','','','satisfactory'),(4,'Urgent Care / Emergency care is available 24 X 7 Please  Contact :- 0712-6627900\r\nReport back to the hospital immediately in case of Fever, Decreased urine output, Persistant, Vomiting, Loose motions, Difficulty in breathing.\r\nReview SOS.\r\n\r\nContinue plaster both upper limb immobilisation for 3 days.\r\nPhysiotherapy.\r\nReview after 7 days / SOS.','','2013-02-22 15:38:00',16,190,'2013-02-16 06:12:19',1,'2013-02-16 07:43:33',1,'A case of Both elbow contusion.','A case of 14 yrs male patient with alleged history of Fall from stage while stunting cycle on 13.02.13 at 10.30 am.\r\nHistory of injury to both elbow joint.\r\nNo history of DM, HTN, BA, IHD.\r\nPatient admitted here for further management and treatment.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n','96.4','86','20','96.4','General examination :- General condition - Moderate / Afrebrile\r\n                       Pulse - Regular, Pallor - Mild, Icterus - Absent, Cyanosis - Absent\r\nRS                  :- Chest clear.\r\nC V S               :- S1 S2 (N)\r\nAbdomen             :- Soft,Non - Tenderness.\r\n                       Liver - Not Palpable / Spleen - Not Palpable\r\nCNS                 :- Conscious, Oriented, Moving all four limb.','','satisfactory'),(5,'Urgent Care / Emergency care is available 24 X 7 Please  Contact :- 0712-6627900\r\nReport back to the hospital immediately in case of Severe headache, Convulsions, fever, Giddiness / Vertigo, Unconsciousness.\r\n\r\nReview after 7 days / SOS.','MDCT Scan Brain with Face (Plain) (15.02.13):\r\n\r\nE/O Fracture right zygomatic arch, posterolateral wall of right orbit, posterior wall of right maxillary sinus with collection in right maxillary, ethmoid sinuses.\r\nFracture of anterior wall of right condylar fossa seen.\r\nProbable fracture of supra-orbital posterior of right frontal bone.','2013-02-23 20:12:00',16,238,'2013-02-18 05:15:42',1,'2013-02-18 06:37:07',1,'A case of Road traffic accident with head injury with facial injury.','This 35 yrs Male patient admitted with history of Road traffic accident Fall from bike due to Imbalance with complaint of unconscious for 2 hours with history of vomiting 2 - 3 times.\r\nComplaint of traumatic injury at right side face with swelling over right orbital region and bleeding from right frontal scalp since on 15.04.13 at 3 pm.\r\nNo History of DM, HTN, BA, IHD, Asthma.\r\nPatient admitted here for further management and treatment.\r\n\r\n\r\n\r\n\r\n\r\n','98.4','68','22','98.4','General examination :- General condition - Not Satisfactory / Afrebrile\r\n                       Pulse - Regular, Pallor - Mild, Icterus - Absent, Cyanosis - Absent RS                  :- Bilateral conducted sound (+).\r\nC V S               :- S1 S2 (N)\r\nAbdomen             :- Soft, Non - Tenderness.\r\n                       Liver - Not Palpable / Spleen - Not Palpable\r\nCNS                 :- Conscious, Oriented, Moving all four limb. Pupils Bilateral Small                              \r\n                       size reacting to light, GCS - E3 M6 V5.','','satisfactory'),(6,'Urgent Care / Emergency care is available 24 X 7 Please  Contact :- 0712-6627900\r\nReport back to the hospital immediately in case of Severe headache, Convulsions, fever, Giddiness / Vertigo, Unconsciousness.\r\n\r\nApply cervical collar.\r\nReview after 7 days / SOS.\r\n\r\n','CT Scan of Brain (14.02.13):\r\n\r\nCT Scan of brain reveals small hemorrhagic contusions in the right medial temporal lobe, left basifrontal and left parietal subpial cortex with minimal surrounding edema.\r\nChronic ischemic changes in bilateral fronto-parietal periventricular white matter, corona radiata and centrum semiovale.\r\nA linear undisplaced fracture in the right squamous temporal bone with marked soft tissue swelling and subgaleal hematoma in the right temporo-parietal scalp.','2013-02-23 15:19:00',16,239,'2013-02-18 05:52:35',1,'2013-02-18 08:12:42',1,'A case of Accidental injury to cervical spine with Head injury (Small temporal lobe contusion).','This 48 yrs Female patient admitted with history of head injury with CLW over forehead.\r\nHistory of Laceration seen over front of neck.\r\nNo History of DM, HTN, BA, IHD, Asthma.\r\nPatient admitted here for further management and treatment.\r\n','98.4','98','22','98.4',' General examination :- General condition - Moderate / Afrebrile\r\n                       Pulse - Regular, Pallor - Mild, Icterus - Absent, Cyanosis - Absent\r\n RS                  :- Chest clear.\r\n C V S               :- S1 S2 (N)\r\n Abdomen             :- Soft, Non - Tenderness.\r\n                       Liver - Not Palpable / Spleen - Not Palpable\r\n CNS                 :- Conscious, Oriented, Moving all four limb.','','satisfactory'),(7,' Urgent Care / Emergency care is available 24 X 7 Please  Contact :- 0712-6627900\r\nReport back to the hospital immediately in case of Fever, Decreased urine output, Persistant, Vomiting, Loose motions, Difficulty in breathing.\r\n\r\nEvery 3rd day dressing.\r\nSuture removal after 10 days.\r\nPhysiotherapy.\r\nHigh protein diet.\r\nReview after 10 days / SOS.','','2013-03-01 08:19:00',16,240,'2013-02-18 07:52:53',1,'2013-02-18 09:09:22',1,'A case of Heterotrophic ossification with right elbow stiffness in a old operated case of monteggia fracture dislocation.','This 23 yrs Male patient admitted for Hypertrophic ossefication of right elbow.\r\nHistory of operated for Closed monteggia fracture dislocation of right ul